import { MDBBtn } from 'mdb-react-ui-kit';
import Box from '../components/Product';
import Carrosel from '../components/galery/Carrosel';
import img6 from '../assets/img6.png'
import { useEffect, useState } from 'react';

export default function Home() {
    const [products, setProducts] = useState([])
    useEffect(() => {
        const fetchProducts = async () => {
            const response = await fetch('https://fakestoreapi.com/products')
            const data = await response.json()
            console.log(data)
            setProducts(data) 
        }
        fetchProducts()
    }, [])

    return (
        <div>
            <section className='carrosel'>
                <Carrosel />
            </section>

            <section>
                <div >
                    <Box products={products} />
                    <Box/>
                    <MDBBtn outline className='mx-2' color='secondary'>
                            ver mais +
                    </MDBBtn><br></br><br></br>
                </div>
            </section>

            <section>
                <img src={img6} alt="imagem de roupas" style={{maxWidth:"90%", height: "auto", marginLeft:"auto", marginRight:"auto", display:"block"}}/>
            </section><br></br>
        </div>
    )
}
